import { useState } from 'react';
import { Link } from 'react-router-dom'

import './Nav.css'
import "bootstrap-icons/font/bootstrap-icons.css";

export default function Nav() {
  const [toggle, setToggle] = useState(false)
  const [navLinks, setNavLinks] = useState(false);
  const [navSocials, setNavSocials] = useState(false);

  const toggleButton = (e) => {
    e.preventDefault();
    if (toggle === false) {
      setToggle(true)

    } else {
      setToggle(false);
    } 
    // So if I can change 'toggle' to either true or false
    // If toggle is true
    // Change 'nav-links' and 'nav-socials' 
  }

  return (
    <nav className='nav'>
      <div className='nav-logo'>
        <Link to="/" className="logo">pH</Link>
      </div>

      <div className="nav-links-container">
        <ul className='nav-links'>
          <Link to="/about">
            <li>about</li>
          </Link>
          <li>contact</li>
          <li>projects</li>
          <li>testimonals</li>
        </ul>
      </div>

      <div className="nav-socials-container">
        <ul id={active ? 'active' : ''} className='nav-socials'>
          <li>
            <i class="bi bi-twitter"></i>
          </li>
          <li>
            <i class="bi bi-instagram"></i>
          </li>
          <li>
            <i class="bi bi-github"></i>
          </li>
          <li>
            <i class="bi bi-linkedin"></i>
          </li>
        </ul>
      </div>

      <a href="" className="nav-burger" onClick={toggleButton}>
        <span className='bar'></span>
        <span className='bar'></span>
        <span className='bar'></span>
      </a>
    </nav>
  )
}
